import React, { useEffect, useState } from "react";

const OwnersTable = () => {
  const [owners, setOwners] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState("");
  const [sortField, setSortField] = useState("owner_code");
  const [sortOrder, setSortOrder] = useState("ASC");

  useEffect(() => {
    fetch(`http://localhost:5000/owners_list?sort=${sortField}&order=${sortOrder}`, { credentials: "include" })
      .then((res) => res.json())
      .then((data) => {
        if (data.success) {
          setOwners(data.owners);
        } else {
          setError(data.message || "Failed to fetch owners");
        }
        setLoading(false);
      })
      .catch((err) => {
        console.error(err);
        setError("Error fetching owners");
        setLoading(false);
      });
  }, [sortField, sortOrder]);

  const handleSort = (field) => {
    if (sortField === field) {
      setSortOrder(sortOrder === "ASC" ? "DESC" : "ASC");
    } else {
      setSortField(field);
      setSortOrder("ASC");
    }
  };

  const arrow = (field) => {
    if (sortField !== field) return "";
    return sortOrder === "ASC" ? " ↑" : " ↓";
  };

  if (loading) return <p>Loading owners...</p>;
  if (error) return <p>{error}</p>;
  if (!owners.length) return <p>No owners found.</p>;

  return (
    <div style={{ overflowX: "auto" }}>
      <table border="1" cellPadding="8" style={{ borderCollapse: "collapse", minWidth: "100%" }}>
        <thead>
          <tr>
            {[
              "owner_code", "salutation", "first_name", "last_name", "nationality", "address1", "address2",
              "city", "state", "country", "zip_code", "mobile_number", "email", "passport_number",
              "date_of_birth", "visa_expiry_date", "passport_expiry_date", "eid_image", "passport_copy",
              "res_visa", "created_by", "approved_by"
            ].map((col) => (
              <th key={col} onClick={() => handleSort(col)} style={{ cursor: "pointer", background: "#007BFF", color: "white" }}>
                {col.replace("_", " ").toUpperCase()} {arrow(col)}
              </th>
            ))}
          </tr>
        </thead>
        <tbody>
          {owners.map((owner) => (
            <tr key={owner.owner_code}>
              <td>{`OW${owner.owner_code.toString().padStart(5, "0")}`}</td>
              <td>{owner.salutation}</td>
              <td>{owner.first_name}</td>
              <td>{owner.last_name}</td>
              <td>{owner.nationality}</td>
              <td>{owner.address1}</td>
              <td>{owner.address2}</td>
              <td>{owner.city}</td>
              <td>{owner.state}</td>
              <td>{owner.country}</td>
              <td>{owner.zip_code}</td>
              <td>{owner.mobile_number}</td>
              <td>{owner.email}</td>
              <td>{owner.passport_number}</td>
              <td>{owner.date_of_birth}</td>
              <td>{owner.visa_expiry_date}</td>
              <td>{owner.passport_expiry_date}</td>
              <td>{owner.eid_image && <img src={`data:image/jpeg;base64,${owner.eid_image}`} alt="EID" width={50} />}</td>
              <td>{owner.passport_copy && <img src={`data:image/jpeg;base64,${owner.passport_copy}`} alt="Passport" width={50} />}</td>
              <td>{owner.res_visa && <img src={`data:image/jpeg;base64,${owner.res_visa}`} alt="Visa" width={50} />}</td>
              <td>{owner.created_by}</td>
              <td>{owner.approved_by}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OwnersTable;
